import React,{Component} from "react";
class NewFilm extends Component{
 render() {
        return (
            <div className="NewFilm">
                <div className="col col-6">
                <img src="./image/cuteCat.jpg" alt="Ảnh minh họa" />
                </div>
            </div>
           
        )
 }
}
export default NewFilm;
